import './Header.css';

function Header(props) {
    return(
        <header>
            <h1 className='heading gradient-text'>
                <a href={props.opensea} target='_blank' rel='noreferrer'>
                    Polygon Squirrels
                </a>
            </h1>
        </header>
    )
}

export default Header;
